Користувач повинен оснастити програмне забезпечення та функції програмного забезпечення (включаючи, але не обмежуючись, створенням нових екземплярів) конфігурацією апаратного та програмного забезпечення, необхідною для користувача.
Користувачі несуть відповідальність за сплату відповідних зборів за користування телефонним зв'язком та широкосмуговим доступом, які необхідно сплатити після підключення до Інтернету.
Користувач несе юридичну відповідальність за поведінку, подію та результат, спричинені використанням цього програмного забезпечення.
Будь-які транзакції та суперечки між користувачами та іншими неавторизованими неофіційними особами не мають жодного відношення до розробника.
Користувач зобов'язаний дотримуватися відповідних законів і нормативних актів Китайської Народної Республіки (якщо користувач є користувачем за межами Китайської Народної Республіки, користувач також повинен дотримуватися законів і правил країни або регіону, до якого він належить).
Користувач не повинен використовувати програмне забезпечення (або деякі можливості та функції програмного забезпечення) для вчинення незаконних дій, а також не повинен використовувати відповідні процеси та послуги, пов'язані з програмним забезпеченням, для вчинення незаконних дій, а наслідки будь-яких дій не повинні бути пов'язані з розробником.
Користувачі несуть власну юридичну відповідальність, пов'язану зі змістом інформації, яку вони публікують. Користувач не має права вводити, публікувати або розповсюджувати будь-який з наступних матеріалів програмного забезпечення, процесів і послуг, пов'язаних з роботою програмного забезпечення, а також не повинен публікувати будь-який з наступних матеріалів у будь-якій формі：

виступаючи проти основних принципів, викладених у Конституції Китайської Народної Республіки;
створення загрози національній безпеці, розголошення державної таємниці, підрив державної влади або підрив національної єдності;
заподіяння шкоди честі та інтересам держави;
розпалювання міжнаціональної ворожнечі, етнічної дискримінації або підрив етнічної єдності;
підрив національної релігійної політики, пропаганда культів і феодальних забобонів;
поширення чуток, порушення соціального порядку або підрив соціальної стабільності;
Поширення непристойностей, порнографії, азартних ігор, насильства, вбивств, терору або підбурювання до злочинів;
ображання або наклеп на інших, посягання на законні права та інтереси інших осіб;
Містить інший контент, заборонений Китайською Народною Республікою законами або адміністративними правилами.
Якщо це не дозволено законом або з письмового дозволу розробника, користувачі не повинні вчиняти будь-які з наведених нижче дій：
Незаконне або неналежне використання Програмного забезпечення та Послуг;
Завдавати шкоди нормальній роботі програмної системи або веб-сайту, навмисно поширювати комп'ютерні віруси та інші руйнівні програми;
вживати будь-яких ненормальних дій під час використання, які можуть вплинути на мережеві служби Програмного забезпечення (включаючи, але не обмежуючись, пошкодження, атаки на сервер або перевантаження сервера тощо);
Видаляти інформацію про авторські права на Програмне забезпечення та його копії.

Якщо користувач здійснює будь-яку поведінку, яка порушує закони та нормативні акти або порушує положення цієї Угоди, розробник має право вжити заходів проти користувача відповідно до тяжкості ситуації, відповідно до цієї Угоди та законів і нормативних актів, включаючи, але не обмежуючись, припинення надання послуг. Якщо обставини будуть серйозними, вони будуть передані до відповідних адміністративних органів для притягнення до адміністративної відповідальності або розслідувані на предмет кримінальної відповідальності.

Якщо ви погоджуєтеся з цими Умовами використання та користуєтеся онлайновими службами Програмного забезпечення, ми збиратимемо таку інформацію：
IP-адреса пристрою, на якому запущено Програмне забезпечення (яка може бути неправильною адресою);
Деяка системна інформація про обладнання, на якому працює Програмне забезпечення;
У разі аварійного завершення роботи програмного забезпечення журнали програмного забезпечення, що працює в системі (включно з деякою інформацією про систему), можуть бути завантажені за згодою користувача, щоб допомогти вирішити проблему та вдосконалити програмне забезпечення.
Інша інформація, яка буде завантажена за згодою користувача (як зазначено в програмному забезпеченні).

1. Призупинення та припинення надання Сервісу Користувача

Якщо користувач публікує незаконну інформацію, серйозно порушує суспільну мораль або порушує заборони закону, розробник зобов'язаний припинити надання послуг користувачу;
У разі вчинення користувачем неправомірної дії при прийомі програмного сервісу розробник має право припинити надану користувачеві послугу (конкретні обставини неналежної поведінки чітко обумовлюються в цій угоді);
Якщо користувач використовує модифіковану версію програмного забезпечення від третьої сторони, він несе свій ризик і юридичну відповідальність.

2. Призупинення, призупинення та припинення роботи Програмного забезпечення та Служб：

У разі виникнення будь-якої з наведених нижче обставин розробник має право припинити або перервати всі або частину послуг програмного забезпечення, і розробник не несе відповідальності перед користувачем або будь-якою третьою стороною за незручності або шкоду, спричинені цим：

a. відповідно до вимог Програмного забезпечення та Служб;
b. Неналежна робота через пошкодження сервера;
c. У зв'язку з раптовим виходом з ладу програмно-апаратного обладнання та електронного комунікаційного обладнання;
d. через збої в лінії оператора мережі або інші збої;
e. у зв'язку з політичними міркуваннями;
f. Причини третіх осіб або інші форс-мажорні обставини.

Розробник залишає за собою право припинити або частково припинити надання Програмного забезпечення та Послуг, коли вважатиме це необхідним, і Розробник може повідомити про це Користувача у формі оголошення, але Розробник не несе відповідальності за будь-які збитки, завдані Користувачу.

Ця Угода регулюється законодавством Китайської Народної Республіки без урахування всіх положень колізійного права;
Невиконання Розробником, несвоєчасне здійснення або повне здійснення прав, що користуються за цим Договором або відповідно до закону, не вважається відмовою від здійснення таких прав, а також не впливає на здійснення Забудовником таких прав у майбутньому;
У межах, дозволених законом, Розробник має право тлумачити умови цієї Угоди;
Користувачі можуть скаржитися та повідомляти про всілякі порушення законів та нормативних актів електронною поштою, будь ласка, надішліть електронний лист на адресу services@mcsl.com.cn.
